import React from 'react';
function Header() {
  return (
    <header>
      <nav className="navbar navbar-expand-lg navbar-dark">
        <p id="title"><b> Sample globe.gl with ReactJS</b></p>
      </nav>
    </header>
  )
}
export default Header;
